import React from 'react';
import "./css/Startseite.css";

class Home extends React.Component {
	render() {
		return (
			<>

				<a className="host_room" href="/host">
					Einen Raum erstellen
				</a>

				<button id="myButton" class="float-left submit-button" >Einen vorhanden Raum beitreten</button>

				<script type="text/javascript">
					document.getElementById("myButton").onclick = function () {href = "/Room"};
				</script>


			</>
		);
	};
}
export default Home;
